INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 1, 126001, 2, 5, 0, 40011, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 325, 24001);
